import React from 'react';
import Axios from 'axios';

export class ChartSection extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            kpi : {}
        }

    }

    componentDidMount() {
        const x = Axios.get('http://localhost:4000/get/kpi/' + this.props.sn)
            .then(res => {
                console.log(res);
                this.setState()
            })
            .catch(err => {
                alert(err);
            });
        console.log(x);
    }

    componentWillUnmount() {

    }

    render() {
        return (
            <div className="robot_chart">
                <div className="chart_section">
                    <h3>WorK Count [CNT]</h3>
                    <div className="chart_cnt">
                        <canvas id="myCountChart"/>
                    </div>
                </div>
                <div className="chart_section">
                    <h3>Temperature [TMP]</h3>
                    <div className="chart_tmp">
                        <canvas id="myTempChart"/>
                    </div>
                </div>
            </div>
        );
    }

}
